commit_message:
prot_finder v0.6 plus prot_binary_matrix v0.5 and README;

prot_finder: correct bug for missing hsp tiling and whole hit e-value, new option '-cov_subject', additions to POD

prot_binary_matrix: new option '-total', enforce mandatory options, changed script name, version switch, autodie, Getopt::Long, usage as HERE

prot_finder v0.5 plus prot_binary_matrix v0.4;

prot_finder: include query proteins only optionally in result multi-fasta subject hit files, option '-best' to include only best blastp hit for each subject locus_tag, queries with no hit stated in STDOUT

prot_binary_matrix: adapted to new 'blast_hits.txt', changed script name
